import React from 'react';
import './component.css'; // Import the CSS file

function Text() {
  return (
    <div className="text-container"> {/* Apply the CSS class */}
      <p>
        {<p>
        Únete a la revolución verde en "Verde Bendito" en el corazón de Córdoba.
        Nuestra plataforma es el puente entre tus buenos deseos y la acción concreta
        para proteger nuestra tierra, aire y agua en la hermosa región de Córdoba.
        Apoyamos a las ONG's ambientalistas más apasionadas y comprometidas en la
        protección de nuestro entorno local. ¿Quieres marcar la diferencia en tu propia
        comunidad? Únete a nosotros y conviértete en un guardián del planeta en Córdoba.
        Cada contribución en "Verde Bendito" es un paso hacia un futuro más sostenible en
        nuestra querida Córdoba, donde la naturaleza florece y la esperanza prevalece.
        Únete a nuestra comunidad de héroes ecológicos cordobeses y haz que el verde de
        nuestra tierra sea bendito una vez más.
      </p>}
      </p>
    </div>
  );
}

export default Text;
